import React from 'react';
import '../App.css'

const ResumePage = () => {
  return (
    <div className="resume-container">
      <h1>Резюме проекту</h1>
      <p><strong>Тема:</strong>  Назва вашого проекту</p>
      <p>Виконавець: Бак Р.С.</p>
      <p>Інформація про курс</p>
      <p>Дата:  Відповідна дата</p>
      <p>Опис:  Короткий опис проекту і його цілей.</p>
      <p>Технології:  Перелік використаних технологій та інструментів.</p>
      // Тут можна додати більше інформації за бажанням
    </div>
  );
};

export default ResumePage;
